    }

    if (pathname === '/todos' && method === 'GET') {
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true, todos: db.todos }));
      return;
    }

    if (pathname === '/todos' && method === 'POST') {
      let body = '';
      req.on('data', chunk => {
        body += chunk.toString();
      });
      req.on('end', () => {
        try {
          const { title } = JSON.parse(body);
          if (!title) {
            res.writeHead(400, { 'Content-Type': 'application/json' });
            res.end(JSON.stringify({ ok: false, error: 'Title is required' }));
            return;
          }
          const newTodo = {
            id: crypto.randomUUID(),
            title,
            done: false,
            createdAt: new Date().toISOString()
          };
          db.todos.push(newTodo);
          saveData(dataPath, db);
          res.writeHead(201, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: true, todo: newTodo }));
        } catch (e) {
          res.writeHead(400, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: false, error: 'Invalid JSON body' }));
        }
      });
      return;
    }

    if (pathname.startsWith('/todos/') && method === 'GET') {
      const todo = findTodo(id);
      if (!todo) {
        res.writeHead(404, { 'Content-Type': 'application/json' });
        res.end(JSON.stringify({ ok: false, error: 'TODO not found' }));
        return;
      }
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true, todo }));
      return;
